import React, { Component } from 'react';
import { Tabs, Tab, Grid, Cell, Card, CardTitle, CardText, CardActions, Button, CardMenu, IconButton } from 'react-mdl';

class Projects extends Component {
    constructor(props) {
        super(props);
        this.state = { activeTab: 0 };
    }
    toggleCategories() {
        if (this.state.activeTab === 0) {
            return (
                <div className="projects-grid">
                    {/* project 1 */}
                    <Card shadow={5} style={{ minWidth: '450', margin: 'auto' }}>
                        <CardTitle style={{
                            color: '#fff', height: '176px',
                            background: 'url(data:image/png;base64,) center/ cover'
                        }}>React Tube</CardTitle>
                        <CardText>
                            YouTubeAPIでReact関連の動画のみ検索！
                    </CardText>
                        <CardActions border>
                            <a href="https://github.com/imamurasyoutarou/React-tube"><Button colored>Gidhub</Button></a>
                            <Button colored>CodePen</Button>
                            <Button colored>Livedemo</Button>
                        </CardActions>
                        <CardMenu style={{ color: '#fff' }}>
                            <IconButton name="share" />
                        </CardMenu>
                    </Card>
                    {/*  project 2 */}
                    <Card shadow={5} style={{ minWidth: '450', margin: 'auto' }}>
                        <CardTitle style={{
                            color: '#fff', height: '176px',
                            background: 'url(data:image/png;base64,) center/ cover'
                        }}>My portfolio</CardTitle>
                        <CardText>
                            SPAのポートフォリオです！レスポンシブ対応
                    </CardText>
                        <CardActions border>
                            <a href="https://github.com/imamurasyoutarou/Myportfplio"><Button colored>Gidhub</Button></a>
                            <Button colored>CodePen</Button>
                            <Button colored>Livedemo</Button>
                        </CardActions>
                        <CardMenu style={{ color: '#fff' }}>
                            <IconButton name="share" />
                        </CardMenu>
                    </Card>
                    {/* project 3 */}
                    <Card shadow={5} style={{ minWidth: '450', margin: 'auto' }}>
                        <CardTitle style={{
                            color: '#fff', height: '176px',
                            background: 'url(data:image/png;base64,) center/ cover'
                        }}>React project #3</CardTitle>
                        <CardText>
                            I'm React
                    </CardText>
                        <CardActions border>
                            <Button colored>Gidhub</Button>
                            <Button colored>CodePen</Button>
                            <Button colored>Livedemo</Button>
                        </CardActions>
                        <CardMenu style={{ color: '#fff' }}>
                            <IconButton name="share" />
                        </CardMenu>
                    </Card>
                </div>
            )

        } else if (this.state.activeTab === 1) {
            return (
                <div><h1>This is Angular</h1></div>
            )
        } else if (this.state.activeTab === 2) {
            return (
                <div><h1>This is Vuejs</h1></div>
            )
        } else if (this.state.activeTab === 3) {
            return (
                <div><h1>This is MongoDB</h1></div>
            )

        }
    }


    render() {
        return (
            <div className="tategory-tabs">
                <Tabs activeTab={this.state.activeTab} onChange={(tabId) => this.setState({ activeTab: tabId })} ripple>
                    <Tab>React</Tab>
                    <Tab>Augular</Tab>
                    <Tab>Vuejs</Tab>
                    <Tab>MongoDB</Tab>
                </Tabs>
                <Grid>
                    <Cell col={12}>
                        <div className="content"> {this.toggleCategories()}</div>
                    </Cell>
                </Grid>
            </div>
        )
    }
}
export default Projects;
